import React, { Component } from 'react';
import {Provider} from 'react-redux';
import './App.css';
import Navbar from './components/navbar.js';

class App extends Component {
  render() {
    return (
      <Provider>
        <div className="App">
          <Navbar/>
          <Container>
            <HomePage/>
          </Container>
        </div>
      </Provider>
    );
  }
}

export default App;
